  \ as \"ProgramTargetQuarter\",\n       \"SALESPROGRAM\" as \"ProgramTargetSalesProgram\"\
  ,\n       \"QUOTA\" as \"ProgramTargetQuota\",\n       \"TYPE\" as \"ProgramTargetTerrType\"\
  ,\n       \"TERRITORYNAME\" as \"ProgramTargetTerrName\",\n       \"TERRITORYSYSID\"\
  \ as \"ProgramTargetTerrSysID\",\n       \"GEO\" as \"ProgramTargetGeo\",\n    \
  \   \"MAJORAREA\" as \"ProgramTargetMajorArea\",\n       \"AREA\" as \"ProgramTargetArea\"\
  ,\n       \"REGION\" as \"ProgramTargetRegion\",\n       \"DISTRICT\" as \"ProgramTargetDistrict\"\
  \nFROM \"EDW_LS\".\"SALES_EM\".\"TOP_ACCOUNTS_PROGRAM_TARGET\";"
